import React, { Component } from 'react';
import './App.css';
import Pushere from './Pushere'

class App extends Component {
  constructor(){
    super();
    this.Pusher=new Pushere();
    this.Pusher.activate();
  }
  render() {
    return (
      <div className="App">
      <h1>Howdy</h1>
      </div>
    );
  }
}

export default App;
